import XCTest
@testable import Safehill_Crypto


let SmallTestImageData = ""
let LargeTestImageDataEncoded = ""



final class HashingTests: XCTestCase {

    override func setUpWithError() throws {
        // Put setup code here. This method is called before the invocation of each test method in the class.
    }

    override func tearDownWithError() throws {
        // Put teardown code here. This method is called after the invocation of each test method in the class.
    }
    
    func verifyStabilityOfHashing(for data: Data) {
        for _ in 0..<10 {
            let hash1 = SHHash.stringDigest(for: data)
            let hash2 = SHHash.stringDigest(for: data)
            XCTAssertEqual(hash1, hash2)
        }
    }
    
    func testEmptyDataHashingStability() throws {
        verifyStabilityOfHashing(for: Data())
    }

    func testSmallImageHashingStability() throws {
        guard let data = Data(base64Encoded: SmallTestImageData) else {
            XCTFail()
            return
        }
        
        verifyStabilityOfHashing(for: data)
    }
    
    func testLargeImageHashingStability() throws {
        guard let data = Data(base64Encoded: LargeTestImageDataEncoded) else {
            XCTFail()
            return
        }
        
        verifyStabilityOfHashing(for: data)
    }

    func testPerformanceExample() throws {
        // This is an example of a performance test case.
        self.measure {
            // Put the code you want to measure the time of here.
        }
    }

}
